import "./footer.css";

function Footer() {
    return (
        <footer className="footer">
          <h2>
            <strong>Todo PC</strong>   
          </h2>  
          <ul>
            <li>Inicio</li>
            <li>Productos</li>
            <li>Nosotros</li>
            <li>Contacto</li>
          </ul>
        </footer>
    );
}

export default Footer;
